import React from 'react';
import { NavLink } from 'react-router-dom'
const Naviger = () => {
    return (
        <div>
            <NavLink to={'/'}>
                < li > Accueil</li>
            </NavLink >
            <NavLink to={'about'}>
                < li > A propos</li>
            </NavLink >
            <NavLink to={'calculatrice'}>
                < li >  Calculatrice</li>
            </NavLink >
        </div >
    );
};

export default Naviger;
